import React from 'react'
import './MyTimeline.css'
import TimelineItem from '@mui/lab/TimelineItem';
import TimelineSeparator from '@mui/lab/TimelineSeparator';
import TimelineConnector from '@mui/lab/TimelineConnector';
import TimelineContent from '@mui/lab/TimelineContent';
import TimelineDot from '@mui/lab/TimelineDot';
import Timeline from '@mui/lab/Timeline';
import { Typography } from '@mui/material'
import AutoAwesomeIcon from '@mui/icons-material/AutoAwesome';

const itemsdata = [
  {name: "2019", text: "test2019"},
  {name: "2020", text: "test2020"}
]
const MyTimeline = ({ title, icon, children }) => {
  return (
    <Timeline className="timeline">
        <TimelineItem className='first__item'>
            <TimelineSeparator>
                <TimelineDot className='timeline__dot__header'>
                  <AutoAwesomeIcon />
                </TimelineDot>
                <TimelineConnector />
            </TimelineSeparator>
            <TimelineContent>
                <Typography variant='h6' className='timeline__header'>
                  {title}
                </Typography>
            </TimelineContent>
        </TimelineItem>

        {children}
        {itemsdata.map((item) => (
          <CustomTimelineItem name={item.name} text={item.text}/>
        ))}
        <CustomTimelineItem name={'test'} text={'testing'}/>
        <TimelineItem >
          <TimelineSeparator className='separator__padding'>
            <TimelineDot variant='outlined' className='timeline__dot'/>
            <TimelineConnector />
          </TimelineSeparator>
            <TimelineContent className='timeline_content'>Code</TimelineContent>
        </TimelineItem>
    </Timeline>
  )
}

export const CustomTimelineItem = ({name, text}) => (
  <TimelineItem >
          <TimelineSeparator className='separator__padding'>
            <TimelineDot variant='outlined' className='timeline__dot'/>
            <TimelineConnector />
          </TimelineSeparator>
            <TimelineContent className='timeline_content'>
              <span>{name}</span> {text}
            </TimelineContent>
  </TimelineItem>
)


export default MyTimeline
